function getLtrGuess() { //find what letter is being guessed
    for (i=0;i<letters;i++) {
      if (guesses[guess-1][i]=='') {
        ltrGuess = i;
        break;
      }
    }
}

function getBackGuess() { //find what letter needs to be deleted
  for (i=letters-1;i>=0;i--) {
    if (guesses[guess-1][i]!='') {
      backGuess = i;
      break;
    }
  }
}


function colorSquares() { //add css animations to all board squares in row
  for (i=0;i<letters;i++) {
    document.getElementById('row' + guess + letters).children[i].classList.add(ansColors[i] + i);
  }
  if (guess!=7) {
    guess+=1;
  }
}

function judgeAnswer() {
  ansColors = ['','','','','','','','','']; //reset ansColors from previous guess
  for (i=0;i<letters;i++) { //check fro GREENS
    if (ansList[i]==wordGuess.slice(i,i+1)) { //if the two equate is samae position...
      ansColors[i] = 'G'; //set that position of ansColors to G
      document.getElementById('key'+wordGuess.slice(i,i+1)).classList.remove('Ykey') //html green animation
      document.getElementById('key'+wordGuess.slice(i,i+1)).classList.add('Gkey')
      document.getElementById('key'+wordGuess.slice(i,i+1)).style.opacity = 1;
      ansList[i] = ''; //remove that letter from list of guesses letters (already been assigned color)
    }
  }
  //console.log('G: '+ansList)
  //console.log('G: '+ansColors)
  for (i=0;i<letters;i++) { //i represents guess position
    for (j=0;j<ansList.length;j++) { //j represents answer position
      if (wordGuess.slice(i,i+1) == ansList[j] && ansColors[i] != 'G') { //if there should be a yellow
        ansColors[i] = 'Y';
        if (document.getElementById('key'+wordGuess.slice(i,i+1)).style.opacity != 1) { //html yellow animation
          document.getElementById('key'+wordGuess.slice(i,i+1)).classList.add('Ykey')
          document.getElementById('key'+wordGuess.slice(i,i+1)).style.opacity = 1;
        }
        ansList[j] = ''; //remove letter from guesses list (already been assigned color)
        break; //stop checking for other letters--prevents errors on dbl ltr words
      }
    }
  } 
   
  //console.log('Y: '+ansList)
  //console.log('Y: '+ansColors)
  for (i=0;i<letters;i++) { //if not yellow or green, make gray
    if (ansColors[i] == '') {
      ansColors[i] = 'N';
      if (document.getElementById('key'+wordGuess.slice(i,i+1)).style.opacity != 1) {
        document.getElementById('key'+wordGuess.slice(i,i+1)).classList.add('Nkey')
          document.getElementById('key'+wordGuess.slice(i,i+1)).style.opacity = 1;
      }
      ansList[i] = '';
    }
  }
    
    colorSquares() //animate board
    if (!ansColors.includes('Y') && !ansColors.includes('N')) { //if all squares are green (win)
      setTimeout(function(){
        document.getElementById('endgamebox').style.display = 'block';
        document.getElementById('endgamebox').classList.remove('fadeout');
        document.getElementById('endgamebox').classList.add('fadein');
        document.getElementById('winlose').innerHTML = 'YOU GOT <a href="https://www.merriam-webster.com/dictionary/'+answer+'" style="color:#4d804e" target="_blank"><u>'+answer+'</u></a> IN <span style="color:#4d804e">'+(guess-1)+' </span>GUESSES!'
      
      }, (letters+2)*250);
        guessed = true;
        document.getElementById('guessesform').value = guess-1;
        document.getElementById('totscoreform').value = ((guess-1)/diffMult).toFixed(3)
        played = true;
    } else { //move onto next guess
      if (guess == 7) { //end of game
        setTimeout(function(){
          document.getElementById('endgamebox').style.display = 'block';
          document.getElementById('endgamebox').classList.remove('fadeout');
          document.getElementById('endgamebox').classList.add('fadein');
          document.getElementById('guessesform').value = 8;
          document.getElementById('totscoreform').value = (8/diffMult).toFixed(3)
          document.getElementById('winlose').innerHTML = 'THE WORD WAS <a href="https://www.merriam-webster.com/dictionary/'+answer+'" style="color:#4d804e" target="_blank"><u>'+answer+'</u></a>';
          guess = 8;
        }, (letters+2)*250);
        played = true;
      }
    }
}

function checkGuess() {
  wordGuess = ''; //resets word guess from previous guess
  ansList = []; //resets list from previous guess
  for (i=0;i<letters;i++) { //adds all guesses to this list
    ansList.push(answer.slice(i,i+1))
  }

  for (i=0;i<letters;i++) {
    wordGuess += guesses[guess-1][i]; //compiles list of guesses into one word
  }
  if (guesses[guess-1][letters-1]=='') { //if word is too short, show short notif
    document.getElementById('short').style.display = 'inline-block';
    document.getElementById('short').classList.remove('fadeout')
    document.getElementById('short').classList.add('fadein')
    setTimeout(function(){
      document.getElementById('short').classList.remove('fadein')
      document.getElementById('short').classList.add('fadeout')
    }, 1500);
    setTimeout(function(){ document.getElementById('short').style.display = 'none' }, 2000);
  } else if (!guessWords.includes(wordGuess)) { //if word isnt in dictionary, show noword notif
    document.getElementById('noword').style.display = 'inline-block';
    document.getElementById('noword').classList.remove('fadeout')
    document.getElementById('noword').classList.add('fadein')
    setTimeout(function(){
      document.getElementById('noword').classList.remove('fadein')
      document.getElementById('noword').classList.add('fadeout')
    }, 1500);
    setTimeout(function(){ document.getElementById('noword').style.display = 'none' }, 2000);
  } else { //if its long enough, and in dictionary, check it
    judgeAnswer()
  }
}

function addLetter(key) { //RUNS WHEN ANY KEY IS CLICKED
  if (guessed == false) {
    if (alphabet.includes(key)) { //adds letter if it is a letter
      let ltr = key.toUpperCase();
      if (guesses[guess-1][letters-1]=='') {
        getLtrGuess() //finds what letter is being guessed
        guesses[guess-1][ltrGuess] = ltr; //adds typed letter to correct spot on JS 'guesses' board
        document.getElementById('row' + guess + letters).children[ltrGuess].innerText = ltr; //adds typed letter to correct spot on html
      }
    } else if (key=='Backspace') { //remove letter
      getBackGuess() //checks what letter needs to be removed
      guesses[guess-1][backGuess] = ''; //removes letter on JS board
      document.getElementById('row' + guess + letters).children[backGuess].innerText = ''; //removes letter from HTML board
    } else if (key=='Enter') {
      checkGuess() //check guess
    }
    //console.log(guess)
  }
}

